// import logo from './logo.svg';
import './headline.css';

const villains = ["me", "her"]

function SingleComponent(props) {
  return (
    <div className={`common ${props.type}`}>
      {props.label}
    </div>
  );
}

function Headline(props) {
  var items = []
  for (const [index, value] of villains.entries()) {
    <div className="flexbox">
    items.push(<SingleComponent type="villain" label={value}/>);
    items.push(<SingleComponent type="action" label={value}/>);
    items.push(<SingleComponent type="victim" label={value}/>);
    items.push(<SingleComponent type="reason" label={value}/>);
    </div>
  }
  return (
    <div>
      {items}
    </div>
  );
}

export default Headline;
